As configurações de permissão específico do aplicativo não concedem permissão Local Ativação para o aplicativo de Servidor COM com CLSID 

{2593F8B9-4EAF-457C-B68A-50F6B8EA6B54}

 e APPID 

{15C20B67-12E7-4BB6-92BB-7AFF07997402}

 ao usuário BYOD-EDUARDO\eddua SID (S-1-5-21-1222459896-856544567-3389853670-1001) do endereço LocalHost (Usando LRPC) que está sendo executado no contêiner de aplicativos Não Disponível SID (Não Disponível). Essa permissão de segurança pode ser modificada com a ferramenta administrativa Serviços de Componentes.

